import { Box } from "@mui/system";
import { Toolbar } from "@mui/material";

// Page to be used for SetupWizard

export const SetupWizard=()=> {
  return (
      <Box
      component="main"
      sx={{ flexGrow: 1, p: 3, marginLeft: {  sm: `200px`, md: `200px`}}}
      >
      <Toolbar />
     <h1>Setup Wizard</h1>
      </Box> 


  );
};
